  const [tables, setTable] = useState([])
  const [columns, setColumns] = useState([])

  useEffect(() => {
    fetch(`/tables/${tables.name.id}/`, {
      'method': 'GET'
    })

  })

  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Home columns={columns} />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
